import React,{useState} from 'react'
import { useNavigate,Link } from 'react-router-dom'
import "../styles/Register.css";

const Register = () => {
  let navigate = useNavigate();
  const [credentials, setCredentials] = useState({"fname":"dnone", "lname":"dnone","email":"","password":""})
  const [placeholder, setPlaceholder] = useState({"name":"dnone","uname":"dnone", "pwd":"dnone"})
  const [height,setHeight] = useState({"fname":"ihide", "lname":"ihide","uname":"ihide", "pwd":"ihide"})

  const onChangelogin = (e) => {
      setCredentials({...credentials,[e.target.name]:e.target.value})
  } 

  const handleSubmit = async (e) => {
    e.preventDefault();
    const response = await fetch ("http://localhost:4000/api/v1/auth",{
      method:'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({name: credentials.name, email: credentials.email, password: credentials.password})
    })
    const json = await response.json()
    if (json.success){
      // Save the auth token and redirect
      localStorage.setItem('token', json.authtoken); 
      navigate('/');
    }
    else{
      alert('try again')
    }
  }


  return (
    <div className='register-con'>
    <form className='lr-form' onSubmit={handleSubmit}>
        <h1 className='lr-f-title'>Register</h1>
        <div className='d-flex'>
            <div>Let's create your credentials</div>
            <div>
                <div className='lr-input-item'>
                    <div className={`lr-placeholder ${placeholder.uname}`}>Email</div>
                    <input className={`uname-input lr-input ${height.uname}`} onFocus={(e)=> {
                            if(!e.target.value){
                                e.target.placeholder="" 
                                setPlaceholder({...placeholder,"uname":"dblock"})
                                setHeight({...height,"uname":"ishow"})
                            }
                        }
                    } 
                    onBlur={(e)=> {
                            if(e.target.value === ''){
                                e.target.placeholder="Enter your email address"
                                setPlaceholder({...placeholder,"uname":"dnone"})
                                setHeight({...height,"uname":"ihide"})
                            }
                        }
                    } 
                    placeholder='Enter your email address' onChange={onChangelogin}  value={credentials.email} type="text"  name="email" id="username"/>
                </div>
                <div className='d-flex'>
                    <div className='lr-input-item'>
                        <div className={`lr-placeholder ${placeholder.pwd}`}>Password</div>
                        <input className={`pwd-input mutli-input lr-input ${height.pwd}`} onFocus={(e)=> {
                                if(!e.target.value){
                                    e.target.placeholder="" 
                                    setPlaceholder({...placeholder,"pwd":"dblock"})
                                    setHeight({...height,"pwd":"ishow"})
                                }
                            }
                        } 
                        onBlur={(e)=> {
                                if(e.target.value === ''){
                                    e.target.placeholder="Enter your password"
                                    setPlaceholder({...placeholder,"pwd":"dnone"})
                                    setHeight({...height,"pwd":"ihide"})
                                }
                            }
                        }   
                        placeholder='Enter your password'  onChange={onChangelogin}  value={credentials.password} type="text"  name="password"id="password"/>
                    </div>
                    <div className='lr-input-item'>
                        <div className={`lr-placeholder ${placeholder.pwd}`}>Password</div>
                        <input className={`pwd-input mutli-input lr-input ${height.pwd}`} onFocus={(e)=> {
                                if(!e.target.value){
                                    e.target.placeholder="" 
                                    setPlaceholder({...placeholder,"pwd":"dblock"})
                                    setHeight({...height,"pwd":"ishow"})
                                }
                            }
                        } 
                        onBlur={(e)=> {
                                if(e.target.value === ''){
                                    e.target.placeholder="Enter your password"
                                    setPlaceholder({...placeholder,"pwd":"dnone"})
                                    setHeight({...height,"pwd":"ihide"})
                                }
                            }
                        }   
                        placeholder='Enter your password'  onChange={onChangelogin}  value={credentials.password} type="text"  name="password"id="password"/>
                    </div>
                </div>
                <div className='d-flex'>
                    <div class="dropdown mutli-input">
                        <div class="btn btn-secondary dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                            Dropdown link
                        </div>
                        <div class="dropdown-menu">
                            <div class="dropdown-item" href="#">Action</div>
                            <div class="dropdown-item" href="#">Another actio</div>
                            <div class="dropdown-item" href="#">Something else here</div>
                        </div>
                    </div>
                    <div className='lr-input-item'>
                        <div className={`lr-placeholder ${placeholder.name}`}>Mobile Number</div>
                        <input className={`uname-input mutli-input lr-input ${height.name}`} onFocus={(e)=> {
                                if(!e.target.value){
                                    e.target.placeholder="" 
                                    setPlaceholder({...placeholder,"mobilenumber":"dblock"})
                                    setHeight({...height,"mobilenumber":"ishow"})
                                }
                            }
                        } 
                        onBlur={(e)=> {
                                if(e.target.value === ''){
                                    e.target.placeholder="Mobile Number"
                                    setPlaceholder({...placeholder,"mobilenumber":"dnone"})
                                    setHeight({...height,"mobilenumber":"ihide"})
                                }
                            }
                        } 
                        placeholder='Mobile Number' onChange={onChangelogin}  value={credentials.mobilenumber} type="text"  name="mobilenumber" id="mobilenumber"/>
                    </div>
                </div>
            </div>
        </div>
        <div className='radio-heading'>Title</div>
